import { Routes, Route } from 'react-router-dom'
import './App.css';

import { SocketProvider } from './providers/Socket';

import StartVideo from "./pages/StartVideo";

function App() {
  return ( 
  <div className="App">
      <SocketProvider>  
        <Routes>
          <Route path="/" element = {<StartVideo />} />
          <Route path="/videoroom/:roomId" element={<h1>화상회의방</h1>} />
        </Routes>
      </SocketProvider>
    </div>
  );
}


  export default App;
